// import { Button, FormGroup, FormControl, ControlLabel } from "react-bootstrap";
import { TextField,FormControlLabel,Checkbox } from '@material-ui/core'
import API from "../API/API";

const SearchField = ({
    handlerSearch
})=> {
    const getData = async(str)=> {
        const data =  await API.companies(str)
        if (data!=companies){
            setCompanies(data)
        }
       
    }

    const [companies,setCompanies]=useState([])
   
    useEffect(()=>{
        const str = document.getElementById("standard-basic").value

        handlerSearch(companies,str)
        
    },[companies])
 
    const onTextChange = (e)=>{
        getData(e.target.value)
    }

    const onCheckChange=(e)=>{
        console.log(e)
    }

    return(
        <div className="Login">
        <TextField id="standard-basic" label="Company name" onChange={e=>onTextChange(e)} />
        <FormControlLabel
            control={
            <Checkbox
                // checked={state.checkedB}
                onChange={onCheckChange}
                name="ELS"
                color="primary"
            />
            }
            label="ELS"
        />
        </div>
    )
}

export default SearchField
